import React  from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import CreateEvent from './createEvent.js';

import 'react-calendar/dist/Calendar.css';
import './App.css';

function App() {
    return (
        <main>
            <Switch>
                <Route path='/' component={CreateEvent} />
            </Switch>
        </main>
    )
}

export default App;
